import React from 'react';
import projectList from '../../../utils/main/section-projects/projectList.js';

function Carousel() {
  const projectCard = projectList.map((item) => (
    <li key={item.index}>
      {item.title}
    </li>
  ));
  return (
    <div className="carousel-container">
      Container
    </div>
  );
}

export default Carousel;
